let grid = new gridBase;

function clearRow() {
  let rows = Array.from(document.querySelectorAll('.row-grid'));
  // alert(`это ${rows}`);
  // alert(rows.length);
  if (rows.length < 1 || !rows) {
    return
  }
  // console.log(document.getElementsByClassName('.row-grid'));
  // alert(typeof(rows[0]));

  for (let i = 0; i < rows.length; i++) {
    // alert(rows[i] + ' yдалил');
    rowsContainer.firstChild.remove();
    // rows[i].innerText = '';
  }
}

function createRows(grid) {
  for (let i = 0; i < grid.length; i++) {
    let row = document.createElement('div');
    row.innerHTML = `
    <a href="https://foxford.ru/courses/${grid[i].course_id}/landing" class="col-grid col-link">
                     <div class="column-subject col-grid"> ${grid[i].full_name} </div></a>
                     <div class="column-teacher col-grid"> ${grid[i].prepod} </div>
                     <div class="column-courseID col-grid"> ${grid[i].parallel_id} </div>
                     <div class="column-parallelID col-grid"> ${grid[i].course_id} </div>
                     `
    row.classList.add("row-grid");
    rowsContainer.appendChild(row);
  }
}



function findGrid(gridID) {
  let grids = grid.grade[classNumber - 1];

  for (let key in grids) {
    if (key === 'schedule_' + classNumber + '_' + gridID) {
      // subjectCol.innerText = grids[key];
      // alert(grids[key]);
      return grids[key];
    }
  }

}

function showGrid(gridID) {
  // if(!subject && !time && !classNumber) {
  //   return
  // }

  // subjectCol.innerText = '';
  // teacherCol.innerText = '';
  clearRow();
  createRows(findGrid(gridID));

  // screen.innerText =  findGrid(classNumber, gridID);

  // screen.innerText = JSON.stringify(grid.grade[classNumber - 1].window[gridID][0]);
  // subjectName.innerText = JSON.stringify(grid.grade[classNumber - 1].schedule);

}







function init() {

  document.querySelector('.class-button-container').addEventListener('click', function (event) {
    let formGrade = '.form-grade' + event.target.innerText;
    let classButtons = Array.from(document.querySelectorAll('.class-button'));
    for (let i = 0; i < 11; i++) {
      let formGrade = '.form-grade' + (i + 1);
      document.querySelector(formGrade).classList.remove('form-grade');
      classButtons[i].classList.remove('class-button-activated');
    }
    event.target.classList.toggle('class-button-activated');
    document.querySelector('.class-button-container').classList.remove('class-button-activated');
    document.querySelector(formGrade).classList.toggle('form-grade');
    classNumber = event.target.innerText;
    
    
  });
  let grids = Array.from(document.querySelectorAll('.select-schedule'));
  for (let i = 0; i < grids.length; i++) {
    grids[i].addEventListener("change", function () {
    gridID = grids[i].value;
    showGrid(gridID);
  });
}


  document.querySelector('.select-subject').addEventListener("change", function () {
    subject = document.querySelector('.select-subject').value;
    // subjectCol.innerText = subject;
    // alert(subject);
  });

}

init();

